import { Routes, Route } from "react-router-dom";
import Home from "./routes/home/home.component"
import { Navigation } from "./routes/home/navigation.component"



const App = () => {
  return (
    <Routes>
      <Route path="/" element={<Navigation />}>
        <Route path="/" element={<Home />} />
      </Route>


    </Routes>
  )
}

export default App;
